  return (
    <div className="expense-item">
      <div>25 de Maio de 2023</div>
      <div className="expense-item__description">
        <h2>Seguro</h2>
        <div className="expense-item__price">R$120,00</div>
      </div>
    </div>
  );
}

export default ExpenseItem;
